} impl MySetWrapper { pub fn first_key(&mut self) -> Option<&Key> { self.iter_next = 0; self.next_key() } pub fn next_key(&mut self) -> Option<&Key> { if let Some(next) = self.myset.keys().nth(self.iter_next) { self.iter_next += 1; Some(next) } else { None } }
} As a result, the wrapper is simple and contains no unsafe code.

